window.bookSummaryJSON = "<p>Bereft of her friends, Lilith must find a new path.</p> <p>As the consequences of her visit to Las Vegas continue to cascade, Lilith finds herself almost alone in Paragon City, while Gina and Rachel travel to England to determine the full extent of what happened to them. With her path forward in life unclear, Lilith decides she needs to build new friendships and decide what it is she truly wishes to do.</p> <p>The only question is whether she has time, as one of the most insane villains on the planet sets his eyes on her.</p>"; 
